import {BrowserRouter as Router,Switch,Route} from 'react-router-dom'
import './App.css';
import Home from './Pages/Home.js';
import Client from "./Pages/Client";
import {UserContext} from "./Tech/UserContext";
import {useState} from "react";

function App() {
    const [user, setUserse] = useState('/LogIn');
  return (
      <Router>
          <UserContext.Provider value={{user, setUserse}}>
          <Switch>
              <Route exact path ='/'>
                 <Home />
              </Route>

              <Route exact path = '/Client'>
                 <Client />
              </Route>

              <Route exact path = '/LogIn'>
                  <Client />
              </Route>
          </Switch>
          </UserContext.Provider>

      </Router>


  );
}

export default App;
